        public static Model CreateCube()
        {
            var model = new Model();
            model.Rotation = new Vector3(81, 358, 351);

            model.Vertices.Add(new Vertex(-100, 100, -100));   // 0
            model.Vertices.Add(new Vertex(100, 100, -100));    // 1
            model.Vertices.Add(new Vertex(-100, -100, -100));  // 2
            model.Vertices.Add(new Vertex(-100, 100, 100));    // 3
            model.Vertices.Add(new Vertex(100, 100, 100));     // 4
            model.Vertices.Add(new Vertex(-100, -100, 100));   // 5            
            model.Vertices.Add(new Vertex(100, -100, -100));   // 6
            model.Vertices.Add(new Vertex(100, -100, 100));    // 7

            int? fillColor1 = Color.FromArgb(140, 140, 140).ToArgb();
            int? fillColor2 = Color.FromArgb(120, 120, 120).ToArgb();
            int? fillColor3 = Color.FromArgb(100, 100, 100).ToArgb();
            int borderColor = Color.Red.ToArgb();

            model.Triangles.Add(new Triangle(
                model.Vertices[0],
                model.Vertices[1],
                model.Vertices[2],
                borderColor, fillColor1));

            model.Triangles.Add(new Triangle(
                model.Vertices[1],
                model.Vertices[6],
                model.Vertices[2],
                borderColor, fillColor1));

            model.Triangles.Add(new Triangle(
                model.Vertices[1],
                model.Vertices[4],
                model.Vertices[6],
                borderColor, fillColor2));

            model.Triangles.Add(new Triangle(
                model.Vertices[4],
                model.Vertices[7],
                model.Vertices[6],
                borderColor, fillColor2));

            model.Triangles.Add(new Triangle(
                model.Vertices[4],
                model.Vertices[3],
                model.Vertices[7],
                borderColor, fillColor1));

            model.Triangles.Add(new Triangle(
                model.Vertices[3],
                model.Vertices[5],
                model.Vertices[7],
                borderColor, fillColor1));

            model.Triangles.Add(new Triangle(
                model.Vertices[3],
                model.Vertices[0],
                model.Vertices[5],
                borderColor, fillColor2));

            model.Triangles.Add(new Triangle(
                model.Vertices[0],
                model.Vertices[2],
                model.Vertices[5],
                borderColor, fillColor2));

            model.Triangles.Add(new Triangle(
                model.Vertices[3],
                model.Vertices[4],
                model.Vertices[0],
                borderColor, fillColor3));

            model.Triangles.Add(new Triangle(
                model.Vertices[4],
                model.Vertices[1],
                model.Vertices[0],
                borderColor, fillColor3));

            model.Triangles.Add(new Triangle(
                model.Vertices[2],
                model.Vertices[6],
                model.Vertices[5],
                borderColor, fillColor3));

            model.Triangles.Add(new Triangle(
                model.Vertices[6],
                model.Vertices[7],
                model.Vertices[5],
                borderColor, fillColor3));

            return model;
        }

